using System; using System.Collections.Generic;  namespace Project3 {     public class CompareAge : IComparer<student>     {         List<student> students = new List<student>();          public int Compare(student x, student y)         {             if (x.Age == null && y.Age == null) return 0;             else if (x.Age == null) return -1;             else if (y.Age == null) return 1;             else return string.Compare(x.Age, y.Age, StringComparison.Ordinal);         }     } }  
